import React from 'react';

function TaskList({ tasks, deleteTask }) {
  return (
    <ul style={{ listStyle: 'none', padding: 0 }}>
      {tasks.map((task) => (
        <li key={task._id} style={{ margin: '1rem 0', display: 'flex', alignItems: 'center' }}>
          <span style={{ flex: 1 }}>{task.text}</span>
          <button onClick={() => deleteTask(task._id)} style={{ marginLeft: 8 }}>
            Delete
          </button>
        </li>
      ))}
    </ul>
  );
}

export default TaskList;
